import math

def find_max_gcd_sequence(N, M):
    min_sum = (1 + M) * M / 2
    if min_sum > N:
        return -1
    max_gcd = -1
    for i in range(int(math.sqrt(N)), 0, -1):
        if N % i == 0:
            d = N // i
            if d * min_sum <= N:
                max_gcd = max(max_gcd, d)
            if i * min_sum <= N:
                max_gcd = max(max_gcd, i)
    if max_gcd == -1:
        return -1
    ans = []
    i = 1
    while len(ans) < M - 1:
        ans.append(i * max_gcd)
        N -= i * max_gcd
        i += 1
    ans.append(N)
    return ans

